import "./Suggestions.scss";
import avatar from "../../assets/avatar.jpg";

function Suggestion() {
  return (
    <div className="Suggestions">
      <div className="profile__row">
        <div className="image__container">
          <img src={avatar} />
        </div>
      </div>
    </div>
  );
}
